import React from 'react';
import './App.css';

const App = () => {
  const fetchData = async () => {
    const response = await fetch('http://localhost:8080/');
    console.log(response);
  }
  fetchData();

  return (
    <div className="App">
      <p>Hello world from App</p>
    </div>
  );
}

export default App;
